import {Box, Typography} from "@mui/material";

export default function Projects() {
    return (
            <Box
                id={"projects"}
                sx={{
                    marginTop: 10,
                    minWidth: "50%",
                    maxWidth: "70%",
                }}>
                <Box>
                    <Typography variant={"subtitle1"}>
                        <span className={"green"}>02.</span>Projects
                    </Typography>
                </Box>
                <Box sx={{display:"flex", width:700}}>
                    <Box sx={{backgroundColor:"red", width:"10%"}}>
                        I
                    </Box>
                    <Box sx={{backgroundColor:"green", width:"90%"}}>
                        am
                    </Box>
                </Box>
            </Box>
    )
}
